import { useState } from "react";
import axios from "axios";

export default function GameplayClusteringUi() {
  const [file, setFile] = useState(null);
  const [isLabeled, setIsLabeled] = useState(false);
  const [gameName, setGameName] = useState("");
  const [result, setResult] = useState(null);
  const [visualization, setVisualization] = useState(null);
  const [progress, setProgress] = useState(0);
  const [uploading, setUploading] = useState(false);
  const [preview, setPreview] = useState(null);

  const handleFileChange = (event) => {
    const selectedFile = event.target.files[0];
    setFile(selectedFile);
    if (selectedFile) {
      setPreview(URL.createObjectURL(selectedFile));
    }
  };

  const updateClusterImage = () => {
    const timestamp = new Date().getTime(); // Unique timestamp to prevent caching
    setVisualization(`http://127.0.0.1:8000/clusters.png?cacheBust=${timestamp}`);
  };

  const handleSubmit = async (event) => {
    event.preventDefault();
    if (!file) {
      alert("Please upload a video file.");
      return;
    }

    const formData = new FormData();
    formData.append("video", file);
    formData.append("is_labeled", isLabeled);
    if (isLabeled) {
      formData.append("game_name", gameName);
    }

    setUploading(true);
    setProgress(0);

    try {
      const response = await axios.post("http://127.0.0.1:8000/upload/", formData, {
        headers: { "Content-Type": "multipart/form-data" },
        onUploadProgress: (progressEvent) => {
          const percent = Math.round((progressEvent.loaded * 100) / progressEvent.total);
          setProgress(percent);
        },
      });

      setUploading(false);
      setResult(response.data);
      updateClusterImage(); // Update clustering visualization after upload
    } catch (error) {
      console.error("Error uploading video:", error);
      alert("Upload failed.");
      setUploading(false);
    }
  };

  return (
    <div className="p-6 max-w-lg mx-auto bg-white rounded-xl shadow-lg space-y-6 border border-gray-200">
      <h1 className="text-2xl font-bold text-gray-800 text-center">üéÆ Gameplay Clustering</h1>
      <p className="text-gray-600 text-center">Upload a video to classify gameplay</p>

      {/* File Upload Section */}
      <form onSubmit={handleSubmit} className="space-y-6">
        <label className="block w-full text-center border-2 border-dashed border-gray-300 p-6 rounded-lg cursor-pointer hover:border-blue-500 transition">
          <input type="file" accept="video/*" onChange={handleFileChange} className="hidden" />
          {preview ? (
            <video className="w-full rounded-md shadow-sm" src={preview} controls />
          ) : (
            <p className="text-gray-500">Click to upload a video</p>
          )}
        </label>

        {/* Labeled Video Option */}
        <label className="flex items-center space-x-2">
          <input type="checkbox" className="h-5 w-5 text-blue-500" checked={isLabeled} onChange={() => setIsLabeled(!isLabeled)} />
          <span className="text-gray-700">Is this a labeled video?</span>
        </label>

        {/* Game Name Input */}
        {isLabeled && (
          <input
            type="text"
            placeholder="Enter Game Name"
            value={gameName}
            onChange={(e) => setGameName(e.target.value)}
            className="block w-full p-3 border border-gray-300 rounded-lg shadow-sm focus:border-blue-500 focus:ring focus:ring-blue-200"
          />
        )}

        {/* Submit Button */}
        <button type="submit" className="w-full px-4 py-3 bg-blue-500 text-white font-semibold rounded-lg hover:bg-blue-600 transition">
          üöÄ Submit Video
        </button>
      </form>

      {/* Upload Progress */}
      {uploading && (
        <div className="w-full bg-gray-200 rounded-full h-6 relative">
          <div
            className="bg-blue-500 h-6 rounded-full transition-all"
            style={{ width: `${progress}%` }}
          ></div>
          <p className="absolute inset-0 flex justify-center items-center text-white font-semibold">{progress}%</p>
        </div>
      )}

      {/* Result Display */}
      {result && (
        <div className="p-6 bg-gray-50 rounded-lg shadow-md border border-gray-200">
          <h2 className="text-lg font-bold text-gray-800">üîç Results</h2>
          <p className="text-gray-700">
            <strong>Match:</strong> {result.message || `üéÆ ${result.game} (Confidence: ${result.distance})`}
          </p>
          {visualization && (
            <img src={visualization} alt="Clustering Visualization" className="mt-4 rounded-lg shadow-md border border-gray-300" />
          )}
        </div>
      )}
    </div>
  );
}
